import React, { Fragment } from "react";


const Nav = (props) => {
  let greeting;

  if (props.user === null) {
		greeting = <p>Hello guest</p>
	} else if (props.user.firstName) {
		greeting = (
			<Fragment>
				Welcome, <strong>{props.user.firstName}</strong>
			</Fragment>
		)
	} else if (props.user.username) {
		greeting = (
			<Fragment>
				Welcome, <strong>{props.user.username} </strong>
			</Fragment>
		)
  }

  return (
    <div>

    <nav className="navbar navbar-expand-lg">

      <div className="app-name">Motivate Me</div>

      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav mr-auto">

          <li className="nav-item active">
            <a className="nav-link" href="/">Home <span className="sr-only"></span></a>
          </li>

          <li className="nav-item">
            <a className="nav-link" href="/profile">Profile</a>
          </li>

          <li className="nav-item">
            <a className="nav-link" href="/quotes"> Quotes</a>
          </li>

        </ul>
        <div className="float-right">
          {greeting}&emsp;&emsp;  
          <a href="/" className="logout" onClick={props.logout}>Logout</a>
        </div>
      </div>
    </nav>  
    </div>
  )
};

export default Nav;
